import React, { useEffect, useState } from 'react'
import ReactGA from 'react-ga'
import QuerySelector from './QuerySelector.jsx'
import StnMetaInput from './StnMetaInput.jsx'
import StnDataInput from './StnDataInput.jsx'
import MultiStnDataInput from './MultiStnDataInput.jsx'
import StnHourlyInput from './StnHourlyInput.jsx'
import GridDataInput from './GridDataInput.jsx'
import GridData2Input from './GridData2Input.jsx'
import GeneralInput from './GeneralInput.jsx'
import Output from './Output'
import HelpTable from './HelpTable'
import Footer from './Footer.jsx'

const App = () => {
  const acis_servers = {
    StnMeta: "https://data.rcc-acis.org/StnMeta",
    StnData: "https://data.rcc-acis.org/StnData",
    MultiStnData: "https://data.rcc-acis.org/MultiStnData",
    GridData: "https://data.rcc-acis.org/GridData",
    GridData2: "https://grid2.rcc-acis.org/GridData",
    StnHourly: "https://data.nrcc.rcc-acis.org/StnData",
    General: "https://data.rcc-acis.org/General/",
  }

  const [wstype, setWstype] = useState('StnData')
  const [input_params, setInput_params] = useState({})
  const [generalArea, setGeneralArea] = useState('')
  const [helpFor, setHelpFor] = useState()
  const [server, setServer] = useState('Any')
  const [acisServerUrl, setAcisServerUrl] = useState(acis_servers[wstype])

  useEffect(() => {
    ReactGA.initialize('UA-47226172-1')
    ReactGA.pageview('Builder-pageview')    
  }, [])

  useEffect(() => {
      let serverurl = acis_servers[wstype]
      const datarccindex = serverurl.indexOf('data.rcc-acis')
      if (datarccindex !== -1 && server !== 'Any') {
        serverurl = serverurl.substring(0,datarccindex+4) + "." + server.toLowerCase() + serverurl.substring(datarccindex+4)
      }
      setAcisServerUrl(serverurl)
  }, [wstype, server])

  const handleQueryChange = (value) => {
    setWstype(value)
//    updateServerUrl(value, server)
    setInput_params({})
    setGeneralArea('')
    setHelpFor('')
  }

  const handleInputStringChange = (inputString) => {
    if (inputString.length > 0) {
      try {
        setInput_params(JSON.parse(inputString))
      } catch {
        return
      }
    }
  }

  const updateInputParams = (changes) => {
    let new_input_params = input_params
    Object.keys(changes).forEach((key) => {
      const value = changes[key]
      if (value || (typeof value === 'object' && Object.keys(value).length > 0)) {
        new_input_params[key] = value
      } else {
        delete new_input_params[key]
      }
    })
    setInput_params({ ...new_input_params })
  }

  const updateServerUrl = (stype, sserve) => {
    let serverurl = acis_servers[stype]
    const datarccindex = serverurl.indexOf('data.rcc-acis')
    if (datarccindex !== -1 && sserve !== 'Any') {
      serverurl = serverurl.substring(0,datarccindex+4) + "." + sserve.toLowerCase() + serverurl.substring(datarccindex+4)
    }
    setAcisServerUrl(serverurl)
  }

  const updateServer = (value) => {
    setServer(value)
 //   updateServerUrl(wstype, value)
  }


  return (
    <div>
      <QuerySelector
        query_types={Object.keys(acis_servers)}
        wstype={wstype}
        handleChange={handleQueryChange}
      />
      {wstype === "StnMeta" && 
        <StnMetaInput 
          updateInputParams={updateInputParams}
          updateHelpFor={setHelpFor}
          input_params={input_params}
        />
      }
      {wstype === "StnData" && 
        <StnDataInput 
          updateInputParams={updateInputParams}
          updateHelpFor={setHelpFor}
          input_params={input_params}
        />
      }
      {wstype === "MultiStnData" && 
        <MultiStnDataInput 
          updateInputParams={updateInputParams}
          updateHelpFor={setHelpFor}
          input_params={input_params}
        />
      }
      {wstype === "StnHourly" && 
        <StnHourlyInput 
          updateInputParams={updateInputParams}
          updateHelpFor={setHelpFor}
          input_params={input_params}
        />
      }
      {wstype === "GridData" && 
        <GridDataInput 
          updateInputParams={updateInputParams}
          updateHelpFor={setHelpFor}
          input_params={input_params}
        />
      }
      {wstype === "GridData2" && 
        <GridData2Input 
          updateInputParams={updateInputParams}
          updateHelpFor={setHelpFor}
          input_params={input_params}
        />
      }
      {wstype === "General" && 
        <GeneralInput 
          updateInputParams={updateInputParams}
          updateHelpFor={setHelpFor}
          updateGeneralArea={setGeneralArea}
          input_params={input_params}
        />
      }
      {helpFor && 
        <HelpTable 
          id={helpFor}
        /> 
      }
      <Output
        input_params={input_params} 
        changedInput={handleInputStringChange}
        generalArea={generalArea}
        acisServer={acisServerUrl}
        server={server}
      />
      {wstype !== 'StnHourly' && wstype !== 'GridData2' &&
        <Footer 
          server={server}
          updateServer={updateServer}
        />
      }
    </div>
  )

}

export default App
